import { Component } from '@angular/core';
import { UserdataService } from 'src/app/shared/userdata.service';
import { Router } from '@angular/router';

@Component({
  selector: 'app-adduser',
  templateUrl: './adduser.component.html',
  styleUrls: ['./adduser.component.css']
})
export class AdduserComponent {
  user: any = {};

  constructor(private userDataService: UserdataService,public router:Router) { }

  addUser(): void {
    this.userDataService.addUser(this.user).subscribe(
      (response) => {
        window.alert('User added successfully!');
        this.clearForm();
        this.router.navigate(['viewstuds']);
        
      },
      (error) => {
        window.alert('Error adding user. Please try again.');
        console.error(error);
      }
    );
  }

  clearForm(): void {
    this.user = {}; // Clear the form fields
  }
}
<div class="registration-form">
    <form class="bg-light" (submit)="addUser()">
        <div class="form-icon">
            <span><i class="bi bi-person-fill-add"></i></span>
        </div>
        <div class="text-center headingdiv bg-primary-subtle fs-3 font-monospace">
            <span>Add Officer Details</span>
        </div>
        <br>
        <div class="form-group">
            <input type="text" class="form-control item" id="username" name="username" placeholder="Name" [(ngModel)]="user.name">
        </div>
        <div class="form-group">
            <select id="disabledSelect" class="form-select item" name="role" [(ngModel)]="user.role">
                <option value="" disabled selected>Role</option>
                <option>Admin</option>
                <option>Training Head</option>
                <option>Placement Officer</option>
            </select>
        </div>
        <div class="form-group">
            <input type="text" class="form-control item" id="email" name="email" placeholder="Email" [(ngModel)]="user.email">
        </div>
        <div class="form-group">
            <input type="text" class="form-control item" id="phone-number" name="password" placeholder="Password" [(ngModel)]="user.password">
        </div>
        <div class="form-group d-flex justify-content-evenly">
            <button type="submit" class="btn btn-block add-account"><i class="bi bi-person-fill-add"></i> Add</button>
            <button type="button" routerLink="/home" class="btn btn-block discard-account"><i class="bi bi-x-circle-fill"></i> Discard</button>
        </div>
    </form>
</div>
